import React from "react";
import TextareaAutosize from "@material-ui/core/TextareaAutosize";
import StarIcon from "@material-ui/icons/Star";
import Button from "@material-ui/core/Button";

const CommentArea = () => {
  return (
    <div className="project-info u-margin-content-medium u-margin-top-medium">
      <h3 className="project-info-title text-active u-margin-bottom-medium u-margin-top-medium">Ý kiến của bạn</h3>
      <form className="comment">
        <TextareaAutosize
          aria-label="minimum height"
          placeholder="Nhập ý kiến tại đây"
          className="comment__textarea"
        />
        <div className="comment__description">Chọn đánh giá dự án</div>

        <div className="comment__item u-margin-bottom-small">
          <StarIcon className="comment__item__star" viewBox="0 0 24 18" />
          <StarIcon className="comment__item__star" viewBox="0 0 24 18" />
          <StarIcon className="comment__item__star" viewBox="0 0 24 18" />
          <StarIcon className="comment__item__star" viewBox="0 0 24 18" />
          <StarIcon className="comment__item__star" viewBox="0 0 24 18" />
        </div>
        <Button className="comment__button" variant="outlined">GỬI BÌNH LUẬN
        </Button>
      </form>
    </div>
  );
};

export default CommentArea;
